pageContext.rootQuery:
query contentPageQuery($lang: String!, $uid: String!) {
  prismic {
    contentPage(lang: $lang, uid: $uid) {
      _meta {
        uid
        type
        lang
      }
      bgImage
      bgColor
      text
      title
      pageTitle
      pageDescription
      pageKeywords {
        keyword
      }
      pagePreviewImage
      asideNavigation {
        ... on PRISMIC_AsideNavigation {
          text
          _linkType
          body {
            ... on PRISMIC_AsideNavigationBodyMenu {
              type
              label
              fields {
                link {
                  ...link
                }
                icon
                linkStyle
                linkText
              }
              primary {
                navLink {
                  ...link
                }
                navText
              }
            }
          }
        }
      }
      body {
        ... on PRISMIC_ContentPageBodyGallery {
          type
          label
          primary {
            anchor
            bgColor
            bgImage
            text
            title
          }
          fields {
            image
            text
            title
          }
        }
        ... on PRISMIC_ContentPageBodyPricingPlans {
          type
          label
          fields {
            priceUnits
            planPrice
            planName
            planDetails
            linkText
            linkStyle
            link {
              ...link
            }
            isFreePlan
          }
          primary {
            bgImage
            bgColor
            title
            text
            anchor
          }
        }
        ... on PRISMIC_ContentPageBodyItemsCollection {
          label
          type
          primary {
            bgColor
            bgImage
            text
            title
            linkStyle
            linkText
            anchor
          }
          fields {
            tag
          }
        }
        ... on PRISMIC_ContentPageBodyText {
          type
          label
          primary {
            title
            text
            bgColor
            bgImage
            anchor
          }
        }
        ... on PRISMIC_ContentPageBodyFeature {
          type
          label
          primary {
            bgColor
            bgImage
            text
            title
            anchor
          }
          fields {
            image
            linkStyle
            linkText
            text
            title
            link {
              ...link
            }
          }
        }
        ... on PRISMIC_ContentPageBodyBlockWithTextAndImage {
          label
          type
          primary {
            anchor
            bgColor
            bgImage
            minHeight
            title
            text
            image
            link {
              ...link
            }
            linkStyle
            linkText
          }
        }
        ... on PRISMIC_ContentPageBodyForm {
          type
          label
          primary {
            anchor
            bgColor
            bgImage
            formScript
            formUrl
            text
          }
        }
      }
    }
  }
}
